import styled from 'styled-components';
import React from "react";
import Map from "../Map"

export default function Main_try() {

  const Container = styled.div`
  position: relative;
  width: 100%;
  height: 100%;

  `;
  const AcaList = styled.div`
  position: absolute;
  width: 25%;
  height: 100%;
  right: 0%;
  background-color : black;
  z-index: 2;
  `;

return (

  <div className='container'>
    <Container>
  <Map/><AcaList/>
    </Container>

  </div>
)
}
